import React from 'react'
import './Navigation.css'
import { NavLink, Outlet, useHistory } from 'react-router-dom'

export default function Navigation() {

    const history = useHistory()

    const onClick = (e) => {
        e.preventDefault()
        history.replace({pathname: '/weather-forecast/8days'})
    }

    return (
        <>
            <nav>
                <ul className='navigation'>
                    <li><NavLink to="/">Weather Now</NavLink></li>
                    <li><NavLink onClick={onClick} to="/weather-forecast">Weather Forecast</NavLink></li>
                </ul>
            </nav>
            <Outlet />
        </>
    )
}
